  \"calcofi-larvae-counts-scientific-names-cp-to-de\",\n\t\"isopen\": false,\n\t\"url\":
  null,\n\t\"notes\": \"Fish larvae counts and standardized counts for larvae captured
  in CalCOFI icthyoplankton nets (primarily vertical [Calvet or Pairovet], oblique
  [bongo or ring nets], and surface tows [Manta nets]). Surface tows are normally
  standardized to count per 1,000 m3 strained. Oblique tows are normally standardized
  to count per 10 m2 of surface sampled. This table includes all tows by species,
  even if zero larvae were captured for the species, i.e., negative tows. The \"Larvae
  Counts Positive Tows\" table includes only tows where one or more larvae were captured
  for the species selected by the user.\",\n\t\"license_title\": null,\n\t\"extras\":
